import { Component } from '@angular/core';

@Component({
  selector: 'oca-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent { }

import { Component, Input, OnInit, Renderer2, ViewContainerRef } from '@angular/core';

@Component({
  selector: 'oca-boton',
  templateUrl: './boton.component.html',
  styleUrls: ['./boton.component.scss']
})
export class BotonComponent implements OnInit {
  @Input() contenido: 'texto' | 'icono+texto' | 'icono' = 'texto';
  @Input() tipo: 'primario' | 'acento' = 'primario';
  @Input() label: string = 'Aceptar';
  @Input() estado: 'activo' | 'over' | 'press' = 'activo';
  constructor(private vista: ViewContainerRef, private renderer: Renderer2) { }
  ngOnInit(): void {
    const componente: HTMLElement = this.vista.element.nativeElement;
    const boton: HTMLElement = componente.getElementsByTagName('button')[0];
    const envoltura: HTMLElement = this.renderer.createElement('div');
    this.renderer.addClass(envoltura, 'envoltura-boton');
    this.renderer.removeChild(componente, boton);
    this.renderer.appendChild(componente, envoltura);
    this.renderer.appendChild(envoltura, boton);
  }
}

styleUrlsData.data:
@use "/src/styles/typo" as typo;
@use "/src/styles/color" as color;

.envoltura-boton {
  box-sizing: border-box;
  display: inline-flex;
  justify-content: center;
  align-items: center;
  padding: 5px;
  height: 50px;
  border-radius: 25px;
  @include color.borde("blanco");
  @include color.sombra("inset");
  .boton {
    @include typo.alcance("boton");
    color: color.$blanco;
    cursor: pointer;
    display: flex;
    flex-direction: row;
    justify-content: center;
    align-items: center;
    border-radius: 20px;
    padding: 10px 20px;
    gap: 10px;
    height: 40px;
    &:hover,
    &:focus,
    &.over,
    &.press {
      border: 1px solid color.$blanco;
    }
    &.primario {
      &:not(.over):not(:hover):not(:focus):not(.press) {
        border: 1px solid color.$primario;
        @include color.fondo-opaco("primario");
      }
      &:hover,
      &:focus,
      &.over,
      &.press {
        background: color.$primario;
      }
      &.press {
        @include color.sombra("boton-primario");
      }
    }
    &.acento {
      &:not(.over):not(:hover):not(:focus):not(.press) {
        border: 1px solid color.$acento;
        @include color.fondo-opaco("acento");
      }
      &:hover,
      &:focus,
      &.over,
      &.press {
        background: color.$acento;
      }
      &.press {
        @include color.sombra("boton-acento");
      }
    }
  }
}

